import React, { useState, useEffect } from 'react';

function App() {
  const [weatherData, setWeatherData] = useState(null);

  useEffect(() => {
    const fetchWeatherData = async () => {
      try {
        const response = await fetch('https://api.tomorrow.io/v4/weather/realtime?location=toronto&apikey=2aj7QwO7BAn76KjXQ6V8Ww5QMcPefSJU');
        if (!response.ok) {
          throw new Error('Failed to fetch weather data');
        }
        const data = await response.json();
        setWeatherData(data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchWeatherData();
  }, []);

  console.log(setWeatherData(data))

  return (
    <div>
      <h1>Real-Time Weather Data for Toronto</h1>
      {weatherData ? (
        <div>
          <p>Temperature: {weatherData.temperature?.value} {weatherData.temperature?.units}</p>
          <p>Weather Description: {weatherData.weather?.description}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default App;
